import React from 'react';
import { GoogleMap, LoadScript, Marker } from '@react-google-maps/api';

const Map = ({ spotsData }) => {
  // Assuming spotsData is an array of study spot objects with coordinates
  // Example: [{ id: 1, name: 'Spot 1', lat: 123.45, lng: -67.89 }, ...]

  const center = { lat: 40.423831939697266, lng: -86.92457580566406 };
  const zoom = 14; // default zoom level

  return (
    <LoadScript googleMapsApiKey="AIzaSyC8DB-8dU06g4iUL84peKG3NtNhtlOkmKM">
      <GoogleMap mapContainerStyle={{ height: '400px', width: '60%' }} center={center} zoom={zoom}>
        {spotsData.map((spot) => (
          <Marker key={spot.id} position={{ lat: spot.lat, lng: spot.lng }} title={spot.name} />
        ))}
      </GoogleMap>
    </LoadScript>
  );
};

export default Map;
